import React from 'react';

const Administrator = () => {
const toDoList = [
    "Prepare notes",
    "Check attence",
    "Upload class materials",
    "Help student to do homework",
    "Make sure student understand pronblems"
];
const AddToTheList = () => {
    return (<div>
        <input id="add" type="text" />
        <label>Add</label>
    </div>
    )
}

return (
    <div className="administrator">
        <h1>Administrator</h1>
        <h3>Todo List</h3>
        {toDoList.map( item => <div>{item} </div> )  }
        <AddToTheList />
    </div>
)

}

export default Administrator;
